type HTTPServer struct {
	s   Server
	mux *chi.Mux
	cfg config
}

func NewServer(s Server, opts ...Option) *HTTPServer {
	srv := &HTTPServer{
		s:   s,
		mux: chi.NewMux(),
		cfg: newConfig(opts...),
	}
	srv.setupRoutes()
	return srv
}

